  render(){
    return(
      <div style={
        position='absolute',
        width='150px',
        height='100vh',
        left='0',
        top='10',
        backgroundColor='#EEEEEE',
        borderRight='1px dotted'
      }
      className="sound-bar" onDragOver={(e)=>this.onDragOver(e)}
        onDrop={(e)=>{this.onDrop(e, "wip")}}>
        <span className="task-header">WIP</span>
          {tasks.wip}
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
